function menuGroup($menuGroup) {
    let output = '<li><a href="#">' + $menuGroup.groupName + '</a>';
    output += '<ul>';
    if ($menuGroup.menus !== null) {
        $menuGroup.menus.forEach(function (k, v) {
            output += menuGroupItem(k.groupName, k.groupIcon, k.groupMenuItems);
        });
    }
    output += '</ul>';
    output += '</li>';
    return output;

    function menuGroupItem($groupName, $groupIcon, $menus) {
        let drpDownClass = '';
        if ($menus !== null) {
            drpDownClass = "is-dropdown";
        }
        let output = "<li class='" + drpDownClass + "'>";
        output += '<a href="#">' +
            '<i class="' + $groupIcon + '"></i>' +
            '<span>' + $groupName + '</span>' +
            '</a>';
        if ($menus !== null) {
            output += menuItemGroup($menus);
        }
        output += "</li>";
        return output;

        function menuItemGroup($menus) {

            let output = "<ul>";
            $menus.forEach(function (k, v) {
                output += menuItem(k.menuName, k.menuLink);
            });
            output += "</ul>";
            return output;

            function menuItem($label, $link) {
                return '<li><a href="' + $link + '">' + $label + '</a></li>';
            }
        }
    }
}






